  end
  
  //------- combinatorial assigns for bar_a_reg_1 (pio read data)
  always @ (*) begin
    l2d_bar_a_reg_1_r = 32'b0;
    l2d_bar_a_reg_1_r [9:0]  = rg_bar_a_reg_1_fld1;
