//
//---------- module foo_jrdl_decode
//
module foo_jrdl_decode
(
  clk,
  reset,
  h2d_pio_dec_address,
  h2d_pio_dec_write_data,
  h2d_pio_dec_write,
  h2d_pio_dec_read,
  l2d_bar_a_reg_0_r,
  l2d_bar_a_reg_1_r,
  l2d_bar_intr_reg1_r,
  l2d_bar_log_reg1_r,
  l2d_bar_log_reg2_r,
